import './App.css';
import { Login, getAuthToken } from './components/Login';
import Dashboard from './components/Dashboard';
import { useEffect } from 'react';

// pull access token out of URL params
const code = new URLSearchParams(window.location.search).get('code');

function App() {
  useEffect()

  return (
    <div className="App">
      { code 
        ? <Dashboard code={code}/>
        : <Login/>
      }
    </div>
  );
}

export default App;
